import "./wrapped.css"

function Two(props){
    useEffect(() => {
        setTimeout(() => {
          window.location.href="/wrapped/3"
        }, 20000)
      }, [])
    return(
        <>
        <div className="two">
            <center>
                {/* first text starts */}
            <h2 className="text-5xl one-text">2023 Wrapped<br></br>Coding</h2>
            {/* first text ends */}
            <h2 className="text-5xl two-text">Hello {props.name}<br></br>Its Wrapped Time Ready?Lets do This!</h2>
            </center>
       
        </div>
        
        </>
    )
}
export default Two;
